import React, { useEffect, useState } from "react";

import { useAuth } from "../provider/authProvider";
import { useNavigate } from "react-router-dom";
import Rosary from "../models/rosary";

const Home = () => {
  //   const navigate = useNavigate();
  const { token } = useAuth();
  const [ros, setRos] = useState();
  useEffect(() => {
    const getRosary = async () => {
      // const today = await Rosary.getByDate("112823");
      const today2 = await Rosary.getByDate("2023/05/30");
      setRos(() => today2.data[0]);
      console.log(today2.data[0]);
      // console.log(today);
    };
    getRosary();
  }, []);
  console.log(ros);
  const parseData = () => {
    for (let data of ros) {
      return (
        <>
          <p>{data}</p>
          <br />
        </>
      );
    }
  };

  return (
    <div>
      <h1>Home page</h1>
      <p>{parseData()}</p>
    </div>
  );
};

export default Home;
